define(function(){function small(count,masc){switch(count){case 2:return masc?"dva":"dvě";case 3:return"tři";case 4:return"čtyři"}return""}return{errorLoading:function(){return"Výsledky nemohly být načteny."},inputTooLong:function(args){var n=args.input.length-args.maximum;return 1==n?"Prosím, zadejte o jeden znak méně.":n<=4?"Prosím, zadejte o "+small(n,!0)+" znaky méně.":"Prosím, zadejte o "+n+" znaků méně."},inputTooShort:function(args){var n=args.minimum-args.input.length;return 1==n?"Prosím, zadejte ještě jeden znak.":n<=4?"Prosím, zadejte ještě další "+small(n,!0)+" znaky.":"Prosím, zadejte ještě dalších "+n+" znaků."},loadingMore:function(){return"Načítají se další výsledky…"},maximumSelected:function(args){var n=args.maximum;return 1==n?"Můžete zvolit jen jednu položku.":n<=4?"Můžete zvolit maximálně "+small(n,!1)+" položky.":"Můžete zvolit maximálně "+n+" položek."},noResults:function(){return"Nenalezeny žádné položky."},searching:function(){return"Vyhledávání…"}}});